  fullName: System.Web.IisTraceListener
  type: Class
  summary: "Fornece um ouvinte que roteia todas rastreamento e depuração de saída para o [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)] infraestrutura."
  remarks: "A classe IisTraceListener conecta o mecanismo de rastreamento de [!INCLUDE[vstecasp](~/add/includes/vstecasp-md.md)] para [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)]. Essa classe de ouvinte permite que os desenvolvedores que criam [!INCLUDE[vstecasp](~/add/includes/vstecasp-md.md)] aplicativos e que implementem o <xref:System.Web.IHttpModule>e <xref:System.Web.IHttpHandler>interfaces para gerar eventos de nível de página, nível de módulo ou manipulador de nível para o [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)] infraestrutura quando o rastreamento está habilitada.</xref:System.Web.IHttpHandler> </xref:System.Web.IHttpModule>      > [!NOTE] > Essa classe de ouvinte não encaminhar [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)] eventos para classes do ASP.NET. Isso inclui o <xref:System.Web.UI.Page>classe e classes que implementam o <xref:System.Web.IHttpModule>ou <xref:System.Web.IHttpHandler>interface.</xref:System.Web.IHttpHandler> </xref:System.Web.IHttpModule> </xref:System.Web.UI.Page>       IisTraceListener foi introduzido no [!INCLUDE[net_v35_long](~/add/includes/ajax-current-ext-md.md)]. Para obter mais informações, consulte [versões e dependências](~/add/includes/ajax-current-ext-md.md)."
